import './index_body.css';

import React, { useEffect } from 'react';
import Particles from 'react-particles-js';

const Index_body = () =>{
	return(
		<React.Fragment>
			<div className="index_body">
				<Particles
    				params={{
	    				"number":{
	    					"value":80,
	    					"density":{
	    						"enable":true,"value_area":800
	    					}
	    				},
	    				"color":{
	    					"value":"#ffffff"
	    				},
	    				"shape":{
	    					"type":"circle",
	    					"stroke":{
	    						"width":0,
	    						"color":"#000000"
	    					},
	    					"polygon":{
	    						"nb_sides":5
	    					},
	    					"image":{
	    						"src":"img/github.svg",
	    						"width":100,"height":100
	    					}
	    				},
	    				"opacity":{
	    					"value":0.5,
	    					"random":false,
	    					"anim":{
	    						"enable":false,
	    						"speed":1,
	    						"opacity_min":0.1,
	    						"sync":false
	    					}
	    				},
	    				"size":{
	    					"value":3,
	    				},
	    				"interactivity":{
	    					"detect_on":"canvas",
	    					"events":{
	    						"onhover":{
	    							"enable":true,
	    							"mode":"repulse"
	    						},
	    						"onclick":{
	    							"enable":true,
	    							"mode":"push"
	    						},
	    						"resize":true
	    					},
	    					"modes":{
	    						"grab":{
	    							"distance":400,
	    							"line_linked":{
	    								"opacity":1
	    							}
	    						},
	    						"bubble":{
	    							"distance":400,
	    							"size":40,
	    							"duration":2,
	    							"opacity":8,
	    							"speed":3
	    						},
	    						"repulse":{
	    							"distance":200,
	    							"duration":0.4
	    						},
	    						"push":{
	    							"particles_nb":4
	    						},
	    						"remove":{
	    							"particles_nb":2
	    						}
	    					}
	    				},
					}} 
				/>
			</div>
		</React.Fragment>
	);
}

export default Index_body;
